import{_ as t,p as e,q as d,Z as a}from"./framework-fdd38eac.js";const o={},c=a('<h1 id="版本的概念" tabindex="-1"><a class="header-anchor" href="#版本的概念" aria-hidden="true">#</a> 版本的概念</h1><p><code>RC=Release Candidate</code>,含义 是&quot;发布候选版&quot;，它不是最终的版本，而是最终版(<code>RTM=Release To Manufacture</code>)之前的最后一个版本。</p><p>广义上对测试有三个传统的称呼：<code>alpha</code>、<code>beta</code>、<code>gamma</code>，用来标识测试的阶段和范围。</p><p><code>alpha</code> 是指内测，即现在说的CB，指开发团队内部测试的版本或者有限 用户体验测试版本。</p><p><code>beta</code> 是指公测，即针对所有用户公开的测试版本。然后做过一些修改，成为正式发布的候选版本时叫做gamma，现在叫做RC（Release Candidate）。</p><table><thead><tr><th>版本名称</th><th>介绍</th><th>说明</th></tr></thead><tbody><tr><td>alpha</td><td>内测版</td><td>内部测试版本</td></tr><tr><td>beta</td><td>公测版</td><td>Beta阶段会一直加入新的功能</td></tr><tr><td>RC</td><td>候选版</td><td>几乎就不会加入新的功能了，而主要着重于改改bug，就会发布正式版了</td></tr><tr><td>Release</td><td>正式版</td><td>稳定版本</td></tr></tbody></table>',6),r=[c];function h(n,s){return e(),d("div",null,r)}const i=t(o,[["render",h],["__file","index.html.vue"]]);export{i as default};
